import fetcher from '../fetcher';

const getCountries = async () => {
    try {
        const countires = await fetcher.get('/countries');
        console.log("heree",  countires.data)
        return countires.data;
    }catch(error){
        console.log(error)
    }
} 

export {getCountries};
